How to get the correct percentage from array of objects with aggregation pipeline<p>I have documents with an array of objects, and I need to do the following:</p>
<ul>
<li>Get the total points of member arrays. On the example, the 2 documents have a total of <strong>5500</strong> points.</li>
<li>Next, get each document's members total points (for Josh it's <strong>2000</strong>, for Carl it's <strong>3500</strong>) and then compute what percent it is against the total points. Formula is: (members' points / total points) * 100 or <strong>(2000 / 5500) * 100</strong> for Josh.</li>
<li>Finally, return the fields _id, leader, members' points, and percentage fields.</li>
</ul>
<p>It should look something like below:</p>
<pre><code>{
  _id: '00001',
  leader: &quot;Josh&quot;,
  memberpoints: 2000,
  percentage: 36.3636
},
{
  _id: '00002',
  leader: &quot;Carl&quot;,
  memberpoints: 3500,
  percentage: 63.6363
}
</code></pre>
<p><strong>These are the documents:</strong></p>
<pre><code>[{
  &quot;_id&quot;: { &quot;$oid&quot;: &quot;00001&quot; },
  &quot;leader&quot;: &quot;Josh&quot;,
  &quot;members&quot;: [
    {
      &quot;name&quot;: &quot;Person A&quot;,
      &quot;points&quot;: 500
    },
    {
      &quot;name&quot;: &quot;Person B&quot;,
      &quot;points&quot;: 500
    },
    {
      &quot;name&quot;: &quot;Person C&quot;,
      &quot;points&quot;: 1000
    }]
  },
  {
  &quot;_id&quot;: { &quot;$oid&quot;: &quot;00002&quot; },
  &quot;leader&quot;: &quot;Carl&quot;,
  &quot;members&quot;: [
    {
      &quot;name&quot;: &quot;Person D&quot;,
      &quot;points&quot;: 1000
    },
    {
      &quot;name&quot;: &quot;Person E&quot;,
      &quot;points&quot;: 1000
    },
    {
      &quot;name&quot;: &quot;Person F&quot;,
      &quot;points&quot;: 1500
    }]
}]
</code></pre>
<p>But, I'm getting the wrong percentage because it seems like it's only getting a single object from the members array. It might have something to do with the $set part of my aggregation pipeline, specifically <strong>[{ $divide: [&quot;$members.points&quot;, &quot;$total&quot;] }, 100]</strong>, but I'm not sure.</p>
<p><strong>Wrong percentage, should be 36.3636</strong></p>
<pre><code>{
  _id: '00001',
  leader: &quot;Josh&quot;,
  memberpoints: 2000,
  percentage: 18.1818
}
</code></pre>
<p><strong>Here is my MongoDB aggregation pipeline:</strong></p>
<pre><code>db.users.aggregate([
{$unwind: &quot;$members&quot;}, 
{$setWindowFields: { output: { total: { $sum: &quot;$members.points&quot; }}}},
{$set: { percentage: { $multiply: [{ $divide: [&quot;$members.points&quot;, &quot;$total&quot;] }, 100] }}},
{$group: { _id: &quot;$_id&quot;, leader: {$first: &quot;$leader&quot;}, memberpoints: {$sum: &quot;$members.points&quot;}, percentage: {$first: &quot;$percentage&quot;}}}])
</code></pre>

