Using a collection's aggregation pipeline with all records of another collection<p>I have two collections:</p>
<p><code>Books</code></p>
<pre><code>{
  &quot;BOOK_ID&quot;: &quot;100&quot;,
  &quot;BOOK_NAME&quot;: &quot;Book 1&quot;,
  &quot;BOOK_DESC&quot;: &quot;abcd&quot;,  
},
{
  &quot;BOOK_ID&quot;: &quot;101&quot;,
  &quot;BOOK_NAME&quot;: &quot;Book 2&quot;,
  &quot;BOOK_DESC&quot;: &quot;efgh&quot;,  
},
{
  &quot;BOOK_ID&quot;: &quot;102&quot;,
  &quot;BOOK_NAME&quot;: &quot;Book 3&quot;,
  &quot;BOOK_DESC&quot;: &quot;ijkl&quot;,  
}
</code></pre>
<p><code>BookGroup</code></p>
<pre><code>{
  &quot;GROUP_ID&quot;: &quot;100&quot;,
  &quot;GROUP_NAME&quot;: &quot;G1&quot;,
  &quot;GROUPS&quot;: [
    {
      &quot;BOOK_ID&quot;: &quot;100&quot;,
      &quot;BOOK_NAME&quot;: &quot;Book 1&quot;
    },
    {
      &quot;BOOK_ID&quot;: &quot;101&quot;,
      &quot;BOOK_NAME&quot;: &quot;Book 2&quot;
    }
  ]
},
{
  &quot;GROUP_ID&quot;: &quot;101&quot;,
  &quot;GROUP_NAME&quot;: &quot;G2&quot;,
  &quot;GROUPS&quot;: [
    {
      &quot;BOOK_ID&quot;: &quot;101&quot;,
      &quot;BOOK_NAME&quot;: &quot;Book 2&quot;
    }
  ]
},
{
  &quot;GROUP_ID&quot;: &quot;102&quot;,
  &quot;GROUP_NAME&quot;: &quot;G3&quot;,
  &quot;GROUPS&quot;: [
    {
      &quot;BOOK_ID&quot;: &quot;100&quot;,
      &quot;BOOK_NAME&quot;: &quot;Book 1&quot;
    },
    {
      &quot;BOOK_ID&quot;: &quot;102&quot;,
      &quot;BOOK_NAME&quot;: &quot;Book 3&quot;
    }
  ]
}
</code></pre>
<p>I have a query to get the associated groups of a single book, following is the query:</p>
<pre><code>db.BookGroup.aggregate([
  {
    &quot;$unwind&quot;: &quot;$GROUPS&quot;
  },
  {
    &quot;$match&quot;: {
      &quot;GROUPS.BOOK_NAME&quot;: &quot;Book 2&quot;
    }
  },
  {
    &quot;$group&quot;: {
      &quot;_id&quot;: null,
      &quot;group_name&quot;: {
        &quot;$push&quot;: &quot;$GROUP_NAME&quot;
      }
    }
  },
  {
    &quot;$project&quot;: {
      &quot;_id&quot;: false,
      &quot;group_name&quot;: true
    }
  }
])
</code></pre>
<p>It is able to get the group names of a single book <code>Book 2</code>. And following is the output:</p>
<pre><code>[
  {
    &quot;group_name&quot;: [
      &quot;G1&quot;,
      &quot;G2&quot;
    ]
  }
]
</code></pre>
<p>It is working as expected. Now I would like to get the groups associated to each book but I am not able to do it using the pipeline.</p>
<p>Following is the expected output:</p>
<pre><code>{
  &quot;BOOK_ID&quot;: &quot;100&quot;,
  &quot;BOOK_NAME&quot;: &quot;Book 1&quot;,
  &quot;BOOK_DESC&quot;: &quot;abcd&quot;,
  &quot;group_name&quot;: [&quot;G1&quot;, &quot;G3&quot;]
},
{
  &quot;BOOK_ID&quot;: &quot;101&quot;,
  &quot;BOOK_NAME&quot;: &quot;Book 2&quot;,
  &quot;BOOK_DESC&quot;: &quot;efgh&quot;,
  &quot;group_name&quot;: [&quot;G1&quot;, &quot;G2&quot;]
},
{
  &quot;BOOK_ID&quot;: &quot;102&quot;,
  &quot;BOOK_NAME&quot;: &quot;Book 3&quot;,
  &quot;BOOK_DESC&quot;: &quot;ijkl&quot;,
  &quot;group_name&quot;: [&quot;G3&quot;]
}
</code></pre>
<p>This is the mongo playground <a href="https://mongoplayground.net/p/SY917FusLhV" rel="nofollow noreferrer">link</a>.</p>
<p>Kindly advise. Thank you.</p>

