How can I add a user to my friends array in my User schema?<p>On my Facebook clone I'm working on I have a button that sends a friend request.</p>
<pre><code>&lt;form action=&quot;/requests&quot; method=&quot;POST&quot;&gt;
  &lt;input type=&quot;hidden&quot; name=&quot;sender&quot; value=&quot;&lt;%= id %&gt;&quot; /&gt;
  &lt;input type=&quot;hidden&quot; name=&quot;receiver&quot; value=&quot;&lt;%= receiverUserId %&gt;&quot; /&gt;
  &lt;button type=&quot;submit&quot;&gt;Send Friend Request&lt;/button&gt;
&lt;/form&gt;
</code></pre>
<p>I also have a POST request in my routes that sends the friend request. It takes the <code>_id</code> value of both users and adds to a <code>FriendRequest</code> schema.</p>
<p>Here is the POST request</p>
<pre><code>router.post(&quot;/requests&quot;, (req, res) =&gt; {
  const { sender, receiver } = req.body;

  // Create a new FriendRequest instance
  const newRequest = new FriendRequest({
    sender,
    receiver,
  });

  // Save the friend request to the database
  newRequest
    .save()
    .then(() =&gt; {
      // Redirect to a success page or send a response indicating success
      res.status(204).send();
    })
    .catch((error) =&gt; {
      // Handle the error appropriately
      res.status(500).send(&quot;Error sending friend request&quot;);
    });
});
</code></pre>
<p>And here is the <code>FriendRequest</code> schema</p>
<pre><code>const friendRequestSchema = new mongoose.Schema({
  sender: {
    type: mongoose.Schema.Types.ObjectId,
    ref: &quot;User&quot;,
    required: true,
  },
  receiver: {
    type: mongoose.Schema.Types.ObjectId,
    ref: &quot;User&quot;,
    required: true,
  },
  status: {
    type: String,
    enum: [&quot;pending&quot;, &quot;accepted&quot;, &quot;rejected&quot;],
    default: &quot;pending&quot;,
  },
  createdAt: {
    type: Date,
    default: Date.now,
  },
});
</code></pre>
<p>Under the <code>/:user/friends</code> route users can either accept or reject the friend request.</p>
<pre><code>router.post(&quot;/requests/:id/accept&quot;, async (req, res) =&gt; {
  const request = await FriendRequest.findById(req.params.id);
  request.status = &quot;accepted&quot;;
  await request.save();
  res.redirect(&quot;/requests&quot;);
});

router.post(&quot;/requests/:id/reject&quot;, async (req, res) =&gt; {
  const request = await FriendRequest.findById(req.params.id);
  request.status = &quot;rejected&quot;;
  await request.save();
  res.redirect(&quot;/requests&quot;);
});
</code></pre>
<p>I also have a User schema</p>
<pre><code>const userSchema = new mongoose.Schema({
  firstname: String,
  lastname: String,
  username: {
    type: String,
    unique: true,
    required: [true, &quot;can't be blank&quot;],
    match: [/^[a-zA-Z0-9]+$/, &quot;is invalid&quot;],
    index: true,
  },
  password: String,
  createdAt: { type: Date, default: Date.now },
  profilePictureURL: String,
  friends: [
    {
      type: mongoose.Schema.Types.ObjectId,
      ref: &quot;User&quot;,
    },
  ],
});
</code></pre>
<p><strong>What I'm trying to do</strong></p>
<p>What I'm trying to do is have it so when a user accepts a friend request, their information gets added to the other persons <code>friends</code> object inside their <code>User</code> schema and vice versa. Right now only the friend request is accepted inside the <code>FriendRequest</code> schema but the <code>friends</code> object inside both <code>User</code> schemas isn't updating to show their new friend and when I check my database after accepting a friend request, the <code>friends</code> object still shows an empty array. I'm struggling with figuring out exactly how I can accomplish adding an accepted friend to the <code>User</code> schema.</p>

