<pre><code>values: [
  {_id: 'x', value: 1},
  {_id: 'y', value: 2},
  {_id: 'z', value: 3}
]
</code></pre>
<p>I want to produce an object field <code>stats</code> with <code>$addFields</code> in order to create specific keys with the specific data:</p>
<pre><code>stats: {
  x: { value: 1 },
  y: { value: 2 },
  z: { value: 3 },
  total: 1+2+3=6
}
</code></pre>
<p>I have this stage so far</p>
<pre><code>$addFields: {
  stats: {
    $reduce: {
      input: '$values',
      initialValue: {
        x: {
          value: 0,
        },
        y: {
          value: 0,
        },
        z: {
          value: 0,
        },
        total: 0
      },
      in: {
        $switch: {
          branches: [
            { case: { $eq: [ '$$this._id', 'x' ] }, then: { $mergeObjects: ['$$value', {'x': {'value': '$$this.value'}}]} },
            { case: { $eq: [ '$$this._id', 'y' ] }, then: { $mergeObjects: ['$$value', {'y': {'value': '$$this.value'}}]} },
            { case: { $eq: [ '$$this._id', 'z' ] }, then: { $mergeObjects: ['$$value', {'z': {'value': '$$this.value'}}]} },
          default: '$$value'
        }
      }
    }
  }
}
</code></pre>
<p>My question; is there a way to &quot;squeeze&quot; another action in the the <code>in</code> stage of the <code>$reduce</code> in order to compute the <code>total</code> without the need of an extra <code>$addFields</code> stage or a second <code>$reduce</code> for a separate field?</p>

